import './projects.css';

function Projects() {
    return (
        <div className="projects">
            <h2>SMART ROBO LAWNMOWER
 (Final Year Project)</h2>
            <ul>
                <li>Smart robot for agricultural field that cuts the grass
powered by solar system.</li>
                <li>Equipped the robot with Hi-Tech Motors and
robust structure to operate in harsh environment.</li>
                <li>Connection builds via IoT and rf transceiver over
                100m long distance for the movement/controlling
purpose.</li>
                <li>Keeping all the expenses in check managed to
build the robot under the set budget.</li>
            </ul>
        </div>
    );
}

export default Projects;
